import '../css/maze.css'
import Grid from './grid.js'

function Maze() {
    var no_rows=new Array(10).fill(true)
    var no_columns=new Array(10).fill(true)
    var grids=''
    no_rows.forEach(()=>{
        no_columns.forEach(()=>{
            grids+=`<Grid height="10px" width="10px" />`
        })
        grids+='</br>'
    })

    return (
        <div className="maze">
            maze
           {grids}
        </div>
    );
};

export default Maze;
